onRowSelected:
{{
storeValue("patient_id", patient_lookup_table.selectedRow.patient_id)
await get_bps_history.run({patient_id: patient_lookup_table.selectedRow.patient_id})
await get_bps_notes.run({patient_id: patient_lookup_table.selectedRow.patient_id})

bps_helper_obj.clear_bps_fields()
}}

menuItem23kviulbq9.onClick:
{{ 

patient_lookup_table.triggeredRow["Segmentation Status"] == 'Needs QC' ? showAlert("Action Disabled While Segmentation Status is 'Needs QC'"):
bps_helper_obj.update_segmentation_status(patient_lookup_table.triggeredRow.patient_id, "Pending")

}}

